import React from 'react'
import { Link } from 'react-router-dom';

export default function Navbar() {
  return (
    <div>
        <p>
        <Link to="/content">Home</Link> | <Link to="/cart">Cart</Link> | <Link to="/Login">Login</Link>
        </p>
    </div>
  )
}
